  import * as React from 'react';
  import Box from '@mui/material/Box';
  import Link from '@mui/material/Link';
  import Grid from "@mui/material/Grid";
  import KeyboardDoubleArrowRightIcon from '@mui/icons-material/KeyboardDoubleArrowRight';
  import Container from '@mui/material/Container';
  import Typography from '@mui/material/Typography';
  import logoo from '../../Asserts/Logos/kiddostardez.png'



  
  const Footer = () => {
    return(
        <Box sx={{ bgcolor: 'background.paper', p: 1}} component="footer" style={{display:'flex',justifyContent:'column'}}>
        <Box sx={{ display: 'flex', alignItems: 'start',width:"156px",height:"110px",marginRight:"60px",backgroundColor:"blue" }}>
            <img src={logoo} alt="Logo" style={{ height: '100px', margin: '10px', flexGrow: 1 }} />
          </Box>

          <Box sx={{ display: 'flex',width:"100px",backgroundColor:"red" ,marginLeft:"300px"}}>
            <h1>jgl</h1>
          </Box>
       
      </Box>
      
        
   
        );}
export default Footer;

